import { Headline } from "../Lable/HeadLines";
import { bgColor3e } from "../Styles/backGroundColor";

export function TrippleLineChart(props){
    const {bgColor=bgColor3e, headLine="No Headline", componentWidth="300px", headlineTop=15, headlineLeft=20, 
            borderRadius="10px", divHeight="500px", divWidth="1000px"} = props

    return (
        <div className="Trplle-Line-Chart" style={{position: "relative", transform:"flex", top:props.top, left:props.left, width:divWidth, 
                height:divHeight, borderRadius:borderRadius, backgroundColor:bgColor}}>

            <Headline text={headLine} width={300} top={headlineTop} left={headlineLeft}/>

        </div>
    )
}
